import React, { useState, useEffect } from 'react';
import axios from 'axios';

const MetricsTable = () => {
  const [metrics, setMetrics] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get(
          'https://api.datadoghq.com/api/v1/metrics',
          {
            headers: {
              'DD-API-KEY': '73a18c91-4533-48c1-9669-34c324c7220f',
              'DD-APPLICATION-KEY': 'epub8fe5f0c9085e4fb05db7a25cb714bad3',
            },
          }
        );
        setMetrics(response.data.metrics);
      } catch (error) {
        console.error('Error fetching metrics:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      <h2>Metrics Table</h2>
      <table>
        <thead>
          <tr>
            <th>Metric Name</th>
            <th>Value</th>
          </tr>
        </thead>
        <tbody>
          {metrics.map((metric) => (
            <tr key={metric.name}>
              <td>{metric.name}</td>
              <td>{metric.value}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default MetricsTable;
